import React, {useEffect, useState} from 'react';
import {completeddocument} from '../data/completeddocument';

const DocumentCompleted = () => {
    const [fields, setFields] = useState([])
    useEffect(() => {
        setFields(completeddocument)
    }, [])
    return (
        <div className="container">
            <div className="document__completed">
                <p> Time </p>
                <p> Node Name </p>
                <p> Operator </p>
                <p> Operation
                    {
                        fields.map((el)=>(
                            console.log(el)
                        ))
                    }
                </p>
                <p> Process Opinion </p>
                <div> Time</div>
                <div> Node Name</div>
                <div> Operator</div>
                <div> Operation</div>
                <div className="document__completed-col">
                    <span> Approved </span>
                    <span> 5minute15seconds </span>
                </div>

            </div>
        </div>
    );
};

export default DocumentCompleted;
